/*eslint max-len: ["error", { "code": 150 }]*/

import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import PropTypes from 'prop-types';
import base from '../../config/api.js';
let api = base.api();


class Data extends Component {
    static propTypes = {
        match: PropTypes.object.isRequired,
        location: PropTypes.object.isRequired,
        history: PropTypes.object.isRequired
    };
    constructor(props) {
        super(props);
        this.getContent = this.getContent.bind(this);
        this.state = {
            type: this.props.type,
            data: [],
            title: "View"
        };
    }

    componentDidMount() {
        this.getContent(this.props.type);
    }

    getContent(type) {
        let that = this;
        let filter;

        switch (type) {
            case "all":
                filter = "/data/";
                break;

            case "ip":
                filter = "/data?ip=";
                break;

            case "url":
                filter = "/data?url=";
                break;

            default:
                this.setState({
                    data: [
                        <p>Start</p>
                    ]
                });
        }

        if (filter) {
            let data = [];
            fetch(api + filter)
                .then(res => res.json())
                .then(function (res) {
                    res.map(function (item) {
                        data.push(
                            <tr key={item.ip}>
                                <td>{ item.ip }</td>
                                <td>{ item.url }</td>
                                <td>{ item.day }</td>
                                <td>{ item.day } { item.month } { item.year }</td>
                                <td>{ item.time }</td>
                            </tr>
                        )
                    });
                    return true;
                })
                .then(() => this.setState({
                    data: [
                        <table>
                            <tr>
                                <th>IP</th>
                                <th>URL</th>
                                <th>Date</th>
                                <th>Time</th>
                            </tr>
                            { data }
                        </table>
                    ]
                }))
        }


    }
    render() {
        return (
            <article>
                { this.state.data[0] }
            </article>
        );
    }
}

export default Data;
